std::vector<string> GetCorrectInfo(TString Process, TString P1Mass){
	vector<string> Info;
	Info.clear();
	if (Process.Contains("GG")){
		for (int i=0; i<GG_Mass.size(); i++){
			if (P1Mass!=GG_Mass.at(i)) continue;
			Info.push_back(GG_Xsection.at(i));
			Info.push_back(GG_RelUnc.at(i));
			break;
		}	
	}
	else if (Process.Contains("BB") || Process.Contains("TT") || Process.Contains("bb") || Process.Contains("tt")){
		for (int i=0; i<BB_Mass.size(); i++){
			if (P1Mass!=BB_Mass.at(i)) continue;
			Info.push_back(BB_Xsection.at(i));
			Info.push_back(BB_RelUnc.at(i));
			break;
		}	
	}

	return Info;
}

